        return "{\"code\":0,\"msg\":\"\",\"time\":\"1605249155\",\"data\":[{\"id\":878,\"title\":\"设计学类\",\"cate_id\":132,\"code\":\"专业代码：135\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"53\",\"course\":\"开设课程 : 公共环境规划、城市景观设计、建筑设计、室内设计、城市雕塑、建筑小品\",\"overview\":\"培养目标：本专业培养具有国际设计文化视野、中国设计文化特色、适合于创新时代需求，集传统平面（印刷）媒体和现代数字媒体，在专业设计领域、企业、传播机构、大企业市场部门、各类院校、研究单位从事视觉传播方面的设计、教学、研究和管理工作的高级应用型专门人才。授予艺术学学士学位。\",\"job\":\"对口职业|平面设计师|多媒体设计师|动画设计师|包装设计师|工业造型设计师|珠宝设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|工艺品设计师|玩具设计师|||\",\"condition\":\"就业情况\\n                                   在企事业、专业设计部门、学校、科研单位从事广告设计、书籍装帧设计、展示设计、CI设计、微机美术设计、装饰艺术设计等方面的应用、教学与科研工作\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":879,\"title\":\"艺术设计学\",\"cate_id\":132,\"code\":\"专业代码：1351\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"38\",\"course\":\"开设课程 : 艺术学、历史学、哲学主要课程：艺术设计概论、艺术设计美学、中国艺术设计史、外国艺术设计史、中国工艺美术史、外国工艺美术史、艺术考古学、艺术设计基础等主要实践性教学环节：社会调研、艺术设计实践、文化史迹考察等。主要课程设置：美术鉴赏、艺术概论、版式设计、文字设计、图形创意、绘画与透视、专业计算机、视觉传达、标志设计、包装概论、包装设计、VI设计、广告设计、素描、色彩等。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1351。培养目标:本专业培养具备中外艺术设计及其应用、传播的历史知识，以及掌握全球艺术设计潮流及其应用和传播，并进行思考、分析、研究和解决相关问题的能力，能在相关机构、院校及出版单位或以个人从业身份开展专业研究、教学及传播工作的复合型创新型人才，并为其在艺术设计及相关理论研究领域的进一步发展奠定一定的基础。培养要求：本专业学生主要学习一般艺术设计基本理论，以及设计通史、专业史、相关学科的学术史等专业基础知识，接受结合专题进行研究并以文字加以清晰表述的基本训练，掌握从事相关专业的研究、教学、编辑与市场推广的能力。毕业生应获得以下几方面的知识和能力：1.掌握一般艺术设计的基础理论，以及艺术设计的历史及市场学、营销学、传播学等专业基础知识；2.掌握在专题研究及中国设计相关问题研究知识领域，学生应当掌握针对具体设计问题的理论知识以及研究方法；3.具有在艺术设计相关领域中针对有关问题进行分析、研究和寻求解决问题方案的初步能力；4.熟悉国家在文化产业及其应用、传播方面的方计、政策和法规；了解全球艺术设计的理论前沿，以及相关领域应用前景和发展动态、行业需求；在艺术设计相关领域具有初步的科学研究和解决具体问题的实际工作能力，具有一定的批判性思维能力。主要实践性教学环节:设计市场与企业考察、文化市场与艺术品市场考察、大众审美与生活方式考察。\",\"job\":\"对口职业|平面设计师|多媒体设计师|动画设计师|包装设计师|工业造型设计师|珠宝设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|工艺品设计师|玩具设计师|||\",\"condition\":\"就业情况\\n                                   该本科专业目前在全国,尤其在甘肃、山东、吉林、辽宁、内蒙古等5个省份开设布点的本科院校较多，导致该专业本科毕业生近两年来顺利就业的概率较低。广告策划与设计企业、印刷包装企业设计部门、室内外装修装饰效果设计、出版社与媒体设计部门从事艺术设计或策划工作。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":880,\"title\":\"视觉传达设计\",\"cate_id\":132,\"code\":\"专业代码：1352\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"34\",\"course\":\"开设课程 : 素描、色彩、构成、图案设计、表现图技法、摄影基础、艺术概论、现代广告设计概论、POP广告手绘技法、广告图形创意、平面广告形象设计、插画设计、世界优秀平面广告设计作品赏析、平面广告设计原理、广告设计艺术表现技法、世界包装设计赏析、港台日视觉艺术赏析、海报招贴设计、机构形象（VI）设计、书籍装帧设计、包装结构与装潢设计、平面设计软件应用（Photoshop、Illustrator）、Indesign排版应用、3DSMAX三维效果表现、印刷工艺。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1352。培养目标:本专业培养具有国际设计文化视野、中国设计文化特色、适合于创新时代需求，集传统平面（印刷）媒体和现代数字媒体，在专业设计领域、企业、传播机构、大企业市场部门、中等院校、研究单位从事视觉传播方面的设计、教学、研究和管理工作的专门人才。培养要求：本专业要求学生具有为国学习的思想和为社会服务的理念，了解专业相关的法律法规,具有较为系统的视觉传播专业理论和专业知识。学生应在设计创新，语言、文字表达能力，社会交流沟通能力等方面得到全面锻炼，并符合国家考级的外语水平。本专业培养规格为应用型创意人才。毕业生应具备以下三个方面的能力：1.在专业能力结构方面，要注重创意、美学、技术表现三方面能力的培养。创新时代创意为先,美学质量和技术表现是完善创意的重要组成部分，因此要从理论课程、基础课程和专业课程三个模块中建立起一个体现这个培养方向的正确指导思想，即课程教学的核心理念要贯穿于创新教学之中，在培养学生创意能力的同时提高其美学和技术能力。2.在专业素质结构方面,要求学生不仅有很强的创意能力，还应具备较好的创意解说能力、文字语言的表达能力和很好的社会沟通能力。这四种能力是专业素质不可缺少的组成部分，因为设计不仅要有个性化，更要注重通过语言、文字、行为和作品与人沟通、与市场和社会沟通。3.在综合知识结构方面，要求学生除了已确定的本科专业知识外，同时具有一定的文学素养，以提高设计的创意想象能力，具有一定的数学、物理知识,使设计具有理性的思维方式和有条理地进行逻辑思维的能力，具有一定的外语水平，具有广阔的视野和交流能力，以及掌握软件应用、获取信息和文献检索的能力。主要实践性教学环节：本专业总体实践教学体系是将专业核心课程与实践教学内容密切地联系在一起，一是课程教学和上机熟悉软件结合，二是应用性专业除了研究性课题外，结合社会、企业的项目课题进行实践训练，为学生积累就业经验。主要专业实验：在传统车间培养学生的动手能力，如在纸艺车间、木工车间、模型加工车间和金属加工车间进行相关设计制作和材料实验。\",\"job\":\"对口职业|平面设计师|多媒体设计师|动画设计师|包装设计师|工业造型设计师|珠宝设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|工艺品设计师|||\",\"condition\":\"就业情况\\n                                   学生在毕业后可以在广告公司、设计公司的平面设计部门担任平面设计师；在电视台、报社、杂志社、大型网站等媒体单位的平面设计部门担任美术编辑；在企事业单位的策划部门担任平面设计师等。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":881,\"title\":\"环境设计\",\"cate_id\":132,\"code\":\"专业代码：1353\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"42\",\"course\":\"开设课程 : 设计规划、景观生态学、地理信息系统、生态恢复和改造\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1353。培养目标：本专业培养适应我国社会主义经济建设的发展需要，掌握专业基础理论、相关学科领域理论知识与专业技能,并具有创新能力的和设计实践能力，能在髙等艺术学校从事环境设计或教学、研究工作，在艺术环境设计机构从事公共建筑室内设计、居住空间设计、城市环境景观与社区环境景观设计、园林设计，并具备项目策划与经营管理、教学与科研工作能力的高素质环境艺术应用型和研究型人才。培养要求：本专业在能力结构方面要求学生应具有一定的设计创新思维意识,初步具备综合运用所学知识分析和解决室内外环境设计工程中遇到的科研、教学、设计等方面问题的能力，能清晰地表达设计思想,熟悉室内外环境设计的程序与方法，能在综合把握环境的功能、空间、材料、结构、外观、尺度、施工工艺和市场需求诸要素的基础上对环境进行合理的改进性设计和创新性设计。本专业还要求学生具备较强的空间表现能力，能用草图、图纸、模型、效果图和计算机图形技术生动、准确地表达设计意图，掌握基本的摄影技能，熟练掌握多种设计软件，熟悉材料及加工工艺，具备综合运用CAD\\/CAM\\/CAE\\/3DS手段进行室内外环境设计的基本能力。同时,本专业人才培养规格一般还有以下要求：1.在素质结构方面，要求具有良好的政治素质、思想素质、道德品质，以及法制意识、诚信意识、团体合作意识;在文化素质上具有较好的中国传统文化素养、文学艺术修养，并具有现代意识、人际交往意识;身心健康。2.在知识结构方面，要求除本专业确定的学科基础知识和专业能力外，同时具有一定的外语、计算机及信息技术应用、文献检索、论文写作等方面的工具性知识，以及文学艺术、历史、哲学、心理学等方面的人文社会科学知识。毕业生应获得以下几方面的知识和能力：1.掌握建筑、环境艺术的基础理论知识,具有专业设计与实践的基本能力；2.掌握建筑与环境艺术的相关技术以及各类材料的施工工艺；3.掌握环境艺术设计表达相关技能与方法，包括徒手艺术表现、计算机应用技术、创意能力与工作方法；4.具有文化艺术与跨学科知识素养，了解我国环境艺术设计领域的方针、政策、法规以及国内外发展动态；5.掌握文献检索、资料査询方法，掌握一门外语，具有一定的设计实施与科研能力；主要实践性教学环节：按环境设计专业方向，进行从项目策划、设计、施工图纸设计、材料和施工工艺设计、完成设计报告书等实战课题。主要专业实验:按环境设计专业方向，进行环境及空间的相关材料性能及施工工艺实验。\",\"job\":\"对口职业|多媒体设计师|工业造型设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|||\",\"condition\":\"就业情况\\n                                   在城市，社区规划人员，居民小区规划专家，建筑师，室内装潢师，园林建筑师，施工经理，功能设施规划人员\\/经理,房地产开发商。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":882,\"title\":\"产品设计\",\"cate_id\":132,\"code\":\"专业代码：1354\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"4\",\"course\":\"开设课程 : 设计素描、设计色彩、三大构成基础、工业设计史、设计方法学、设计心理学、工程制图、产品表现技法、人机工程学、计算机产品辅助设计、产品系统设计、产品造型设计、陶艺产品设计、材料与工艺、产品改良设计、产品模型制作等。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1354。培养目标:本专业培养具有“厚基础、宽口径、重能力”、“知识、能力、素质”协调发展，具有扎实的工业设计基础理论知识及产品造型能力、良好的职业技能和职业素质，能在企事业单位、专业设计部门、教学科研单位从事以产品创新为重点的设计、管理、科研或教学工作,也能从事与产品设计相关的视觉传达设计、信息设计、环境设施设计或展示设计工作的应用型研究型人才。培养要求：本专业在能力结构方面要求学生应具有一定的设计创新思维意识，初步具备综合运用所学知识，分析和解决工业产品造型设计过程中遇到的研究、开发、设计等方面问题的能力；能清晰地表达设计思想，熟悉产品设计的程序与方法，能在综合把握产品的功能、材料、结构、外观、加工工艺、内部机构和市场需求诸要素的基础上对产品进行合理的改进性设计和开发性设计。本专业还要求学生具备较强的形象表现能力，能用草图、图纸、模型、效果图和计算机图形技术生动、准确地表达设计意图，掌握基本的摄影技能；熟练掌握多种设计软件，熟悉材料及加工工艺；具备综合运用CAD\\/CAM\\/CAE手段设计开发产品的基本能力。同时，本专业人才培养规格一般还有以下要求：1.在素质结构方面，要求具有良好的政治素质、思想素质、道德品质，以及法制意识、诚信意识、团体合作意识;在文化素质上具有较好的中国传统文化素养、文学艺术修养，并具有现代意识、人际交往意识。2.在知识结构方面，要求除本专业确定的学科基础知识和专业能力外，同时具有一定的外语、计算机及信息技术应用、文献检索、论文写作等方面的工具性知识，以及文学艺术、历史、哲学、心理学等方面的人文社会科学知识。毕业生应获得以下几方面的知识和能力：1.掌握相关工业造型设计专业方向领域内的基本理论和基本知识；2.掌握相关产品模具开发专业方向领域内的设计方法和有关技术；3.具备相关材料与制作工艺专业方向领域的知识和进行设计制作的基本能力；4.熟悉相关产品设计专业方向领域内的相关方针、政策和法规；5.了解相关产品设计专业方向领域内产品设计的前景、需求发展动态；6.具有初步的科学研究和实际工作能力，具有一定的批判性思维能力。主要实践性教学环节：按产品设计专业方向，将专业核心课程与实践教学内容密切地联系在一起，进行产品从策划、设计、模具设计、模型制作、完成产品设计报告书等实践课题教学。主要专业实验:按产品设计专业方向，在产品设计公司、科研单位进行工业产品的相关材料性能及加工工艺实验。\",\"job\":\"对口职业|平面设计师|多媒体设计师|动画设计师|包装设计师|珠宝设计师|现代工艺设计人员|艺术\\/设计总监|工艺品设计师|玩具设计师|||\",\"condition\":\"就业情况\\n                                   产品设计专业就业比较广泛，各种生产消费品的公司都需要开发适应市场的新产品，例如电子产品，家具，汽车等等。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":883,\"title\":\"服装与服饰设计\",\"cate_id\":132,\"code\":\"专业代码：1355\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"19\",\"course\":\"开设课程 : 中外服装史、中国民族服装史、服装造型工艺学、服装服饰设计基础、时装画技法、发型与化妆、人体工程学、服装材料工艺学、服装概论、计算机应用、服装眼用性能测试、服装设计、服饰设计等。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1355。培养目标:本专业培养能从事服装与服饰设计策划和时装研究方向，具有较强的设计创造能力和动手制作能力，具有较强的市场设计意识和市场竞争能力，掌握服装企业、服装市场的基本运作知识，以及把握时尚潮流并进行流行预测的基本方法，能在服装艺术设计领域与应用研究型领域及艺术设计机构从事设计、研究、教学、管理等方面工作的高级专门人才。培养要求：本专业学生应能够掌握服装与服饰设计的基本理论、基本专业知识和基本专业技能，能够理解服装与服饰设计的概念和掌握设计方法，通晓从灵感到表现、从绘画到造型的全过程。同时，本专业人才培养规格一般还应具备以下要求：1.在素质结构方面，要求具有良好的政治素质、思想素质、道德品质，具备法制意识、诚信意识和团体合作意识;在文化素质上要求具有较好的人文学科知识和艺术修养；具有现代意识、人际交往意识;要求身心健康。2.在知识结构方面，要求除掌握艺术设计的基本理论、基本知识和专业能力外，同时还应具有一定的外语、计算机及信息技术应用、文献检索、论文写作等方面的工具性知识，以及艺术、历史、心理学等方面的人文社会科学知识。毕业生应获得以下几方面的知识和能力：1.掌握艺术设计创造的专业技能和方法，具有各类服装款式设计、服装结构设计、服饰配件设计以及成衣制作的能力，掌握服装美术知识、服装画、服装色彩、图案设计、手工印染、摄影等一些与服装设计相关的基础知识及操作能力；2.具有独立进行艺术设计实践的基本能力，具有服装广告设计、商品展示设计的能力；3.了解有关经济、文化、艺术事业的政策和法规，具有服装生产、经营管理以及市场预测的初步能力；4.了解国内外艺术设计的发展动态，掌握服装历史、服装美学及社会心理学知识，具有较强的审美能力。主要实践性教学环节:本专业总体实践教学体系，由所属教育范畴的艺术实践和属综合教育范畴的社会实践共同构建而成，目的是着重理解和掌握本专业所学知识和技能，提高应用能力、教学与研究能力、社会活动能力、口头和书面表达能力，并将专业核心课程与实践教学内容密切地联系在一起,结合社会、企业的项目课题进行实践训练，为学生积累就业经验。\",\"job\":\"对口职业|纸样师|服装设计师|花型图案设计师|家用纺织品设计师|鞋业设计师|服装设计总监|||\",\"condition\":\"就业情况\\n                                   毕业生适宜在轻工、纺织、商业、外贸等部门的服装工厂或服装设计单位从事服装、服饰设计、研究工作，亦可从事服装、服饰设计的教学工作。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":884,\"title\":\"公共艺术\",\"cate_id\":132,\"code\":\"专业代码：1356\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"37\",\"course\":\"开设课程 : 装饰基础、雕塑基础、材料与工艺、建筑与环境设计、空间形态设计、展示设计、公共景观设计、园林建筑设计、公共设施设计、环境雕塑造型、壁画与浮雕、数码图形处理等。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1356。培养目标:本专业培养理论与实践相结合、有创意能力，能在室内外公共空间中进行艺术创造与视觉设计以满足相应的城市环境美化与人文关怀需求的专门艺术设计人才。毕业生可到各级市政规划局、交通部门、建筑和规划部门、各类设计院所、专业设计机构等政府部门和企事业单位从事创作、设计、研究、教学及艺术工程管理等工作。培养要求：本专业学生主要通过艺术造型能力与视觉设计能力的训练，掌握现代城市的公共景观、公共场所等领域空间造型规律，学习与培养艺术工程、艺术化设施、陈设艺术品等设计、制作及施工能力。本专业要求学生分别对公共艺术理论知识、实践知识进行学习和研究，涵盖公共艺术本体形态、艺术形式、创作形式、创作观念、方法、技巧及审美意识等综合内容。毕业生应获得以下几方面的知识和能力：1.掌握公共艺术的基本理论和基本知识；2.掌握相关公共艺术领域内的设计制作方法和有关技术；3.具有相关公共艺术领域内的公共艺术品进行设计制作的基本能力；4.熟悉相关公共艺术领域内的相关方针、政策和法规；5.了解城市公共艺术领域各种艺术表现手段的应用前景、需求发展动态；6.具有初步的科学研究和实际工作能力，具有一定的批判性思维能力。主要专业实验:按不同公共艺术品创作手段,进行公共艺术品创作的相关材料性能实验。\",\"job\":\"对口职业|包装设计师|工业造型设计师|现代工艺设计人员|艺术\\/设计总监|||\",\"condition\":\"就业情况\\n                                   毕业生可到各级市政规划局、交通部门、建筑和规划部门、各类设计院所等政府部门和企事业单位从事设计、研究、教学及管理等工作。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":885,\"title\":\"工艺美术\",\"cate_id\":132,\"code\":\"专业代码：1357\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"36\",\"course\":\"开设课程 : 中外美术通史、中外工艺美术通史，工艺美术概论、绘画基础、美学、专业写作、古汉语、中国文学史、考古学、博物馆学、中国工艺美术史、中国文化史、民俗学、民族学、管理学等。实践环节：结合教学，组织学生参加社会调查、业务实习等实践活动。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为1357。培养目标:本专业培养将手工艺传统理论与实践相结合、有创意能力，能在文化艺术部门、传统工艺力卩工领域、设计公司、学校等企事业部门从事各种传统与现代工艺美术品设计制作以及相关教学与研究，设计管理工作方面的德、智、体等方面全面发展的高级专门人才。培养要求：本专业学生主要根据传统工艺如烧造、锻冶、染织、编扎、雕刻、木工、髹饰工艺等富有地方和民族特色，能反映中国古典文化精神的传统工艺美术主要门类如陶瓷、玻璃、漆艺、染织、雕刻、金属工艺等不同专业方向，学习相关专业方向的基本理论和基本知识，接受在专业方向所规定的各方面的基本训练,掌握专业方向领域内进行设计制作的基本能力，熟练掌握相关专业必要的工艺技能,了解材料性能及加工工艺等知识，同时培养学生实际动手操作能力，为今后的设计制作打下坚实的基础。毕业生应获得以下几方面的知识和能力：1.掌握相关工艺美术专业方向领域内的基本理论和基本知识；2.掌握相关工艺美术专业方向领域内的设计方法和有关技术；3.具有相关工艺美术专业方向领域内的工艺美术品进行设计制作的基本能力；4.熟悉相关工艺美术专业方向领域内的相关方针、政策和法规；5.了解相关工艺美术专业方向领域内产品的应用前景、需求和发展动态;6.具有初步的科学研究和实际工作能力，具有一定的批判性思维能力。主要实践性教学环节：按不同专业方向，进行工艺美术品设计制作。\",\"job\":\"对口职业|包装设计师|工业造型设计师|珠宝设计师|现代工艺设计人员|艺术\\/设计总监|工艺品设计师|玩具设计师|||\",\"condition\":\"就业情况\\n                                   毕业生适宜在博物馆、工艺美术展览馆、工艺美术研究所、出版社、美术报刊编辑部等文化、教育、宣传、理论研究单位从事管理、编辑、考古等实际工作和教学及研究工作。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":886,\"title\":\"数字媒体艺术\",\"cate_id\":132,\"code\":\"专业代码：1358\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"4\",\"course\":\"开设课程 : CSS网页设计,ASP动态网页设计,XML语言,平面版式设计,视频特效与编辑,网络信息检索,程序设计语言、素描、动画概论、数字平面艺术、数字色彩艺术、数字立体艺术、三维图形设计、数字媒体技术及应用、数据结构、图像处理技术、计算机图形学、计算机网络、数据库系统原理、软件工程、Windows编程、CAD技术、JAVA语言、动画运动规律、计算机动画原理与技术、虚拟现实技术、视觉传达设计、游戏程序设计、数字媒体后期制作等。\",\"overview\":\"本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的基本专业，专业代码为8271。培养目标:本专业培养掌握信息与通信领域的基础理论与方法，具备数字媒体制作、传输与处理的专业知识和技能，并具有一定的艺术修养，能综合运用所学知识与技能分析和解决实际问题，能在计算机技术、网络技术和数字通信技术领域、传统的广播、电视、电影领域，以及电脑动画、虚拟现实等新一代的数字传播媒体领域、专业设计机构、企业、传播机构、院校、研究单位从事数字媒体方面的设计、教学、研究和管理工作的复合型应用型人才。培养要求：本专业学生在学习数理、英语、计算机等基础课程的同时，还需具有良好的科学素养和美术修养，既懂技术又懂艺术，能利用计算机等新的媒体设计工具进行艺术作品的设计和创作，能综合运用计算机技术、通信技术、数字信号处理技术进行数字媒体设计。同时,本专业人才培养规格一般还有以下要求：1.在素质结构方面,要求具有良好的政治素质、思想素质、道德品质，以及法制意识、诚信意识、团体合作意识;在文化素质上具有较好的中国传统文化素养、文学艺术修养，并具有现代意识、人际交往意识。2.在知识结构方面，要求除本专业确定的学科基础知识和专业能力外，同时具有一定的外语、计算机及信息技术应用、文献检索、论文写作等方面的工具性知识；以及文学艺术、历史、哲学、政治思想道德、心理学等方面的人文社会科学知识。毕业生应获得以下几方面的知识和能力：1.掌握相关计算机专业方向领域内的基本理论、基本知识；2.掌握相关数字媒体专业方向领域内的设计方法和有关技术；3.具备摄影摄像相关专业方向领域的知识和基本操作能力；4.熟悉数字媒体设计专业方向领域内的相关方针、政策和法规；5.了解相关数字媒体设计专业方向领域的前景、需求和发展动态；6.具有初步的科学研究和实际工作能力，具有一定的批判性思维能力。主要实践性教学环节：多媒体网页设计、摄影与摄像、Flash动画设计、数字音视频制作、数字媒体网络传输等多个实践环节，它们与毕业设计一起构成完整的实践教学环节。此外，专业实践还包括在电视台、影视公司、网络媒体公司、传媒业、广告业、娱乐游戏业、动画设计公司、建筑设计（建筑漫游和环境设计）、人居环境设计和教育等行业进行实验环节。\",\"job\":\"对口职业|多媒体设计师|动画设计师|工业造型设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|||\",\"condition\":\"就业情况\\n                                   本专业方向为电视台、数字电影制作公司、互动娱乐公司、广告公司、电视频道及栏目包装部门、电视剧制作部门、动画公司及其它各影视制作机构等单位培养具有较高影视制作理论水平和数字艺术素养，能够驾驭最先进的数字影视技术，熟悉数字影视制作的生产流程，在CG技术与艺术领域具有较高造诣，能进行数字影视节目策划与创作、数字电影电视特效制作、电视片头设计与制作、电视栏目及频道包装的科学和艺术相结合的复合型高级人才。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":887,\"title\":\"艺术与科技\",\"cate_id\":132,\"code\":\"专业代码：1359\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"37\",\"course\":\"开设课程 : 艺术学、工学、文学主要课程：素描、色彩、三大构成、装饰基础、透视学、工程与制图、展示设计、环境设施设计、展示空间表现技法、电脑设计软件应用、广告设计、印刷制稿与工艺、展示模型设计与制作、展示道具设计与制作、人体工程学、材料与预算、国画、书法、会展概论、会展广告及传媒、会展法规、大型活动组织与管理。主要实践环节：写生、采风、市场调研、专业考察、会展企业实习、毕业实习、毕业设计（毕业论文）。\",\"overview\":\"由原音乐科技与艺术专业和会展艺术与技术专业合并而成，本专业属于国家教育部212年9月最新颁发的《普通高等学校本科专业目录（212年）》中的特设专业，专业代码为1359T。培养目标：本专业培养具有现代会展设计知识与创新能力、艺术设计学教学和研究等方面的知识和能力，能在艺术设计教育、研究、设计、出版和文博等单位从事艺术设计学教学、研究、编辑等方面工作的专门人才。艺术与科技专业是212教育部颁布的高校本科专业目录的特设专业。本专业培养德、智、体全面发展的，既具备扎实的艺术设计能力、又熟悉工程技术与材料、懂得会展管理等基本知识，适应能力强、知识面宽，能适应中国会展业国际化发展需要的，具有开拓创新能力及团队协作精神，能在会展业相关企事业单位、专业设计机构从事会展艺术设计与制作的复合型、应用型高级专门人才。本专业坚持理论与实践相结合，注重艺术设计、工程技术、会展策划方面知识与能力的综合训练与培养。要求学生系统掌握艺术设计的专业技能和理论知识，熟悉中外会展艺术设计的历史、现状、行业发展动态和相关的政策法规，掌握与本专业相关的工程技术、材料预算、管理与策划各个知识要素，初步掌握英语听、读、译能力，具备较强的学习能力和创新能力，能独立进行会展艺术设计、工程实施，能胜任展会项目整体策划和设计、展会环境设计、具体展位和节事活动、会议等相关艺术设计工作。\",\"job\":\"对口职业|多媒体设计师|包装设计师|工业造型设计师|现代工艺设计人员|人物造型设计师|艺术\\/设计总监|||\",\"condition\":\"就业情况\\n                                   毕业生主要输送到会展公司、会展中心、政府会展机构、会展行业协会、环境设计公司、广告部门、专业型设计机构、赛事策划公司、艺术设计部门、各类新闻媒体及宣传部门、新闻出版单位、教育单位或培训机构等企事业单位，从事企业策划及品牌推广、会展空间艺术设计、会展策划运作、会展技术项目实施、广告经营与管理、教学、培训与科研等工作。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":980,\"title\":\"陶瓷艺术设计\",\"cate_id\":132,\"code\":\"专业代码：1351\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"48\",\"course\":\"开设课程 : 未知\",\"overview\":\"•专业简介暂无•培养目标暂无•培养要求暂无•名人学者暂无\",\"job\":\"对口职业|||\",\"condition\":\"就业情况\\n                                   • 就业方向暂无\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":981,\"title\":\"新媒体艺术\",\"cate_id\":132,\"code\":\"专业代码：13511\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"34\",\"course\":\"开设课程 : 未知\",\"overview\":\"•专业简介暂无•培养目标该专业培养掌握新媒体艺术和技术的相关原理、知识和技能，具有新媒体艺术修养，能在互联网新媒体、移动应用设计、虚拟现实艺术等领域完成新媒体短视频创意策划与制作、移动APP设计、新媒体运营等工作，能够在互联网新媒体企业、传统媒体新媒体部门、专业院校、设计机构等单位从事和媒体相关工作的高级专业复合型人才。•培养要求暂无•名人学者暂无\",\"job\":\"对口职业|||\",\"condition\":\"就业情况\\n                                   • 就业方向该专业毕业生可在新媒体门户企业、互联网短视频企业、网络电视台、传统媒体集团、广告公司、数字出版机构，以及政府、高校等单位和部门从事新媒体创意策划、设计、运营与管理等工作，具有广阔的职业发展前景。同时可攻读媒体相关研究生进行继续深造。\",\"createtime\":1588997970,\"updatetime\":1588997970},{\"id\":982,\"title\":\"包装设计\",\"cate_id\":132,\"code\":\"专业代码：13512\",\"years\":\"学制：4年\",\"degree\":\"授予学位：艺术学学士\",\"male\":\"38\",\"course\":\"开设课程 : CATIA三维建模、Photoshop、理论力学、广告设计、包装结构、标志设计、企业视觉识别(VI)设计。专业课程:包装造型与装潢设计、包装印刷工艺与经济成本核算、现代设计史\",\"overview\":\"•专业简介包装设计是一门综合运用自然科学和美学知识，为在商品流通过程中更好的保护商品，并促进商品的销售而开设的专业学科。•培养目标本专业培养掌握平面包装设计、广告艺术设计领域的专业知识及专业技能，能够独立完成一件产品的造型，包装结构、包装装潢等一系列的设计，创造出一件产品相对完整的运输、销售体系，适应包装设计、广告艺术设计、企业企划(营销)设计岗位的需要，具有良好职业素养和可持续发展能力的高素质、高技能人才。•培养要求本专业是平面设计与结构设计的有机结合，是广告设计专业的延伸。要求学生在广告、设计、材料、营销、包装、储运等多个相关领域综合掌握一定得理论知识及专业技能。•名人学者郑雪来、戴帆、陈绘等\",\"job\":\"对口职业|||\",\"condition\":\"就业情况\\n                                   • 就业方向包装设计专业的就业前景非常广泛，主要就业于流通企业、包装企业、包装材料、广告传播、包装科研机构、设计公司、企业单位里的包装部门等。\",\"createtime\":1588997970,\"updatetime\":1588997970}]}\n";
